Converts a `[T; N]` into a `HashSet<T>`.

If the array contains any equal values,
all but one will be dropped.

# Examples

```
use std::collections::HashSet;

let set1 = HashSet::from([1, 2, 3, 4]);
let set2: HashSet<_> = [1, 2, 3, 4].into();
assert_eq!(set1, set2);
```
